import React from "react";
import { FormControl, FormGroup, Input, InputLabel, Typography, Button } from "@mui/material";

const ContainerStyle = {
	width: "50%",
};

const LoginPage = () => {
	const handleValueChange = () => {
		console.log("Value Changed");
	};

	const handleClick = () => {
		console.log("Button Clicked");
	};

	return (
		<FormGroup>
			<Typography variant="h4" align="center" gutterBottom>
				{" "}
				Login{" "}
			</Typography>

			<FormControl>
				<FormGroup>
					<InputLabel>Email</InputLabel>
					<Input type="email" placeholder="Enter Email" onChange={() => handleValueChange()} />
				</FormGroup>
			</FormControl>
			<FormControl>
				<FormGroup>
					<InputLabel>Password</InputLabel>
					<Input type="password" placeholder="Enter Password" onChange={() => handleValueChange()} />
				</FormGroup>
			</FormControl>
			<Button variant="contained" color="primary" onClick={() => handleClick()}>
				{" "}
				Login{" "}
			</Button>
		</FormGroup>
	);
};

export default LoginPage;
